tinymce.PluginManager.add('jbimages',function(editor,url){function jbBox(){editor.windowManager.open({title:'Import an image',file:url+'/dialog-v4.htm',width:350,height:135,buttons:[{text:'Close',classes:'widget btn primary first abs-layout-item',onclick:'close'}]})}editor.addButton('jbimages',{tooltip:'Import an image',icon:'image',text:'Import an image',onclick:jbBox});editor.addMenuItem('jbimages',{text:'Import an image',icon:'image',context:'insert',onclick:jbBox})});